for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b'\xa4X\xaf\xe0\xdf\xe5\xa1\x9e {b\xf8\xf1Q(\xcf\xf2\xf5/\xd1\xb5;*\xb1?\x9d\xf1\xc1\xb8(<W', b'\xf8\xb5\x9e\x18\x85\x11\x07\x1d\xfa\xe5\xab\xc8\xa3N\x82-KM\xfahYx\xc7\xd1\xc9\xd7\xfbG\xd9\xbd\xc5\xb0', b'\xe3ZI_\xc5_\x91\x17\x89\x0b\x9az\xdd\xce\xca={.\xb3E\xf4\x9a\xe84&\xa16\xb6\x00\xa5\xb0-'])
_I = _xor([b'\xcd\xbf\xf4\xa1\xed\x98\x126\xc63{\x88\\\xe6yf', b'[\x9b\xbaM\xe9\x97\x8fT\xa0V_\xdf\xc40{\x80'])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

